import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { FaGithub, FaExternalLinkAlt, FaCode, FaEye } from 'react-icons/fa';

const Projects = () => {
  const [activeFilter, setActiveFilter] = useState('all');

  const projects = [
    {
      title: "E-Commerce Platform",
      description: "A full-stack e-commerce platform with payment integration, user authentication, and admin dashboard.",
      image: "https://via.placeholder.com/400x250/3B82F6/FFFFFF?text=E-Commerce",
      technologies: ["React", "Node.js", "MongoDB", "Stripe", "AWS"],
      category: "fullstack",
      github: "https://github.com/yourusername/ecommerce",
      live: "https://ecommerce-demo.com",
      featured: true
    },
    {
      title: "Task Management App",
      description: "A collaborative task management application with real-time updates and team collaboration features.",
      image: "https://via.placeholder.com/400x250/10B981/FFFFFF?text=Task+App",
      technologies: ["React", "Firebase", "Material-UI", "Redux"],
      category: "frontend",
      github: "https://github.com/yourusername/task-app",
      live: "https://task-app-demo.com",
      featured: true
    },
    {
      title: "API Gateway Service",
      description: "A microservices API gateway with authentication, rate limiting, and request routing capabilities.",
      image: "https://via.placeholder.com/400x250/F59E0B/FFFFFF?text=API+Gateway",
      technologies: ["Node.js", "Express", "Redis", "Docker", "Kubernetes"],
      category: "backend",
      github: "https://github.com/yourusername/api-gateway",
      live: null,
      featured: true
    },
    {
      title: "Portfolio Website",
      description: "A responsive portfolio website built with modern web technologies and smooth animations.",
      image: "https://via.placeholder.com/400x250/8B5CF6/FFFFFF?text=Portfolio",
      technologies: ["React", "Tailwind CSS", "Framer Motion"],
      category: "frontend",
      github: "https://github.com/yourusername/portfolio",
      live: "https://your-portfolio.com",
      featured: false
    },
    {
      title: "Data Analytics Dashboard",
      description: "A real-time data visualization dashboard with interactive charts and data filtering.",
      image: "https://via.placeholder.com/400x250/EF4444/FFFFFF?text=Analytics",
      technologies: ["React", "D3.js", "Python", "PostgreSQL"],
      category: "fullstack",
      github: "https://github.com/yourusername/analytics-dashboard",
      live: "https://analytics-demo.com",
      featured: false
    },
    {
      title: "Chat Application",
      description: "A real-time chat application with file sharing, emoji support, and user presence indicators.",
      image: "https://via.placeholder.com/400x250/06B6D4/FFFFFF?text=Chat+App",
      technologies: ["React", "Socket.io", "Node.js", "MongoDB"],
      category: "fullstack",
      github: "https://github.com/yourusername/chat-app",
      live: "https://chat-app-demo.com",
      featured: false
    }
  ];

  const filters = [
    { name: 'all', label: 'All Projects' },
    { name: 'fullstack', label: 'Full Stack' },
    { name: 'frontend', label: 'Frontend' },
    { name: 'backend', label: 'Backend' }
  ];

  const filteredProjects = activeFilter === 'all' 
    ? projects 
    : projects.filter(project => project.category === activeFilter);

  return (
    <section id="projects" className="py-20 bg-terminal-bg">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl font-bold text-terminal-text mb-4">Featured Projects</h2>
          <div className="w-24 h-1 bg-primary-500 mx-auto mb-8 glow-effect"></div>

          {/* Filter Buttons */}
          <div className="flex flex-wrap justify-center gap-4">
            {filters.map((filter) => (
              <button
                key={filter.name}
                onClick={() => setActiveFilter(filter.name)}
                className={`px-6 py-2 rounded-full font-medium transition-all duration-200 ${
                  activeFilter === filter.name
                    ? 'bg-primary-500 text-terminal-bg shadow-lg glow-effect'
                    : 'bg-terminal-bg border border-terminal-accent/30 text-terminal-text/80 hover:border-primary-500/50'
                }`}
              >
                {filter.label}
              </button>
            ))}
          </div>
        </motion.div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {filteredProjects.map((project, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 50 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -10 }}
              className="bg-terminal-bg border border-terminal-accent/20 rounded-lg shadow-lg overflow-hidden hover:shadow-2xl hover:border-primary-500/50 transition-all duration-300 glow-effect"
            >
              {/* Project Image */}
              <div className="relative overflow-hidden">
                <img
                  src={project.image}
                  alt={project.title}
                  className="w-full h-48 object-cover transition-transform duration-300 hover:scale-110"
                />
                {project.featured && (
                  <div className="absolute top-4 right-4 bg-primary-500 text-terminal-bg px-3 py-1 rounded-full text-sm font-medium glow-effect">
                    Featured
                  </div>
                )}
              </div>

              {/* Project Content */}
              <div className="p-6">
                <h3 className="text-xl font-bold text-terminal-text mb-2">
                  {project.title}
                </h3>

                <p className="text-terminal-text/80 mb-4 line-clamp-3">
                  {project.description}
                </p>

                {/* Technologies */}
                <div className="flex flex-wrap gap-2 mb-6">
                  {project.technologies.map((tech, techIndex) => (
                    <span
                      key={techIndex}
                      className="px-2 py-1 bg-primary-500/20 text-primary-500 rounded text-xs font-medium border border-primary-500/30"
                    >
                      {tech}
                    </span>
                  ))}
                </div>

                {/* Project Links */}
                <div className="flex gap-4">
                  <a
                    href={project.github}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="flex items-center gap-2 text-terminal-text/60 hover:text-primary-500 transition-colors duration-200"
                  >
                    <FaGithub />
                    <span className="text-sm">Code</span>
                  </a>

                  {project.live && (
                    <a
                      href={project.live}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="flex items-center gap-2 text-terminal-text/60 hover:text-primary-500 transition-colors duration-200"
                    >
                      <FaExternalLinkAlt />
                      <span className="text-sm">Live Demo</span>
                    </a>
                  )}
                </div>
              </div>
            </motion.div>
          ))}
        </div>

        {/* View More Projects Button */}
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.5 }}
          viewport={{ once: true }}
          className="text-center mt-12"
        >
          <a
            href="https://github.com/yourusername"
            target="_blank"
            rel="noopener noreferrer"
            className="inline-flex items-center gap-2 bg-primary-600 text-white px-8 py-3 rounded-lg font-semibold hover:bg-primary-700 transition-colors duration-200"
          >
            <FaGithub />
            View More Projects
          </a>
        </motion.div>
      </div>
    </section>
  );
};

export default Projects;
